update log_summary
SET total_records = ${text.line.count:minus(1)},
blank_lines = ${text.line.count:minus(${text.line.nonempty.count})}
where ff_uuid= '${files_uuid}';

select student_attendance_agg_refresh('last_1_day');
select student_attendance_agg_refresh('last_7_days');
select student_attendance_agg_refresh('last_30_days');
delete from student_attendance_exception_agg where year =${hd:substringBefore('|')} and month=${hd:substringAfter('|')};
delete from student_attendance_temp where ff_uuid='${zip_identifier}';

update log_summary
SET datatype_mismatch = ${count.invalid.lines}
where ff_uuid= '${files_uuid}'
